import {
  Box,
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  Image,
} from '@chakra-ui/react';

const Dashboard = () => {
  return (
    <Box
      bgColor="white"
      w="100%"
      display="flex"
      h="auto"
      padding="32px"
      gap="8px"
    >
      <Box bgColor="blue.50" w="100%" height="auto" padding='16px'>
        <Image src={window.location.origin + '/bx-group.png'} width='40px' height='40px' />
      </Box>
    </Box>
  );
};

export default Dashboard;
